import React from 'react'
import FilterButtton from './FilterButtton'
import classes from "../../css/filterPanel.module.css"
function FilterPanel(props) {
  const setFilter=(data)=>{
    props.set
  }
  return (
    <div className={classes.panel}>
      <FilterButtton type={"xs"} setFilter={setFilter}/>
      <FilterButtton type={"s"} setFilter={setFilter}/>
      <FilterButtton type={"m"} setFilter={setFilter}/>
      <FilterButtton type={"l"} setFilter={setFilter}/>
      <FilterButtton type={"xl"} setFilter={setFilter}/>
    </div>
  )
}

export default FilterPanel
